import React from 'react'

import Form from './common/form'

class CustomersForm extends Form {
  render() {
    return (
      <div className="container">
        <div className="row justify-content-center">
          <div className="col-lg-8">
            <h1>Edit Movie</h1>
          </div>
        </div>
      </div>
    )
  }
}

export default CustomersForm
